import React, { useState } from "react";
import menu from "../../Utils/images/menu.png";

import "bootstrap/dist/css/bootstrap.min.css";
import { Accordion, useAccordionToggle } from "react-bootstrap";
import { Navbar, Nav,  } from "react-bootstrap";
import "../Navi/Navi.css";
function Navi() {
  const [show, setShow] = useState(true);

  function CustomToggle({ eventKey }) {
    const decoratedOnClick = useAccordionToggle(eventKey, () => setShow(!show));

    return (
      <button
        type="button"
        style={{ border: "none", backgroundColor: "rgba(255,255,255,.0)" }}
        onClick={decoratedOnClick}
      >
        {" "}
        <img
          alt=""
          src={menu}
          width="46"
          height="46"
          className="d-inline-block align-top"
        />
      </button>
    );
  }

  return (
    <Navbar collapseOnSelect expand="xxl" id='nav'>
  <Navbar.Toggle  aria-controls="responsive-navbar-nav">{menu}</Navbar.Toggle>
  <Navbar.Collapse id="responsive-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link href="#/">Home</Nav.Link>
      <Nav.Link href="#/about">About Me</Nav.Link>
      <Nav.Link href="#/projects">My Projects!</Nav.Link>
      <Nav.Link href="#memes">Contact</Nav.Link>
    </Nav>
  </Navbar.Collapse>
</Navbar>
  );
}

export default Navi;
